import React from "react";

function People(props) {
  //Condition if statement and Map function to loop through array


  return (
    <div>
      {props.peopleList.length ? (
        <ul className="list-group">
          <h2>Featured People</h2>

          {props.peopleList.map(result => (
            <li className="list-group-item" key={result.ID}>
              <b>{result.name.first} {result.name.last}</b> {result.location.state} {result.email}
            </li>
          ))}
        </ul >
      ) : (
          <h2>Sorry No People</h2>
        )}
    </div>
  )
}

export default People;
